import React from "react"
import Ndata from "./Ndata"

const Cart = ({ author, date, tags, title, subtitle, contentLink, imageUrl, alt }) => {
  const cardClassName = alt ? 'blog-card alt' : 'blog-card';

  return (
    <>
   

      <div className='content grid product'>
        {Ndata.map((val, index) => {
          return (
            <div className='box' key={index}>
              <div className='img'>
                <img src={val.cover} alt='' />
              </div>
              <h4>{val.name}</h4>
              <span>${val.price}</span>
            </div>
          )
        })}
      </div>


    </>
  )
}


export default Cart
